CREATE TABLE states(
   id           INTEGER  NOT NULL PRIMARY KEY 
  ,name         VARCHAR(80) NOT NULL
  ,country_id   INTEGER  NOT NULL
  ,country_code VARCHAR(2) NOT NULL
  ,country_name VARCHAR(36) NOT NULL
  ,state_code   VARCHAR(5) NOT NULL
  ,type         VARCHAR(45)
  ,latitude     VARCHAR(20)
  ,longitude    VARCHAR(20)
);
